<body>
    <script src="js/echarts.js"></script>
    <script src="js/flexible.js"></script>
<!-- 头部盒子 -->
    <header>
        <h1>数据可视化Echarts</h1>
        <div class="showTime"></div>
        <script>
            var t = null;
            t = setTimeout(time,1000);
            function time() {
                clearTimeout(t);//清除定时器
                dt = new Date();
                var y = dt.getFullYear();
                var mt = dt.getMonth() + 1;
                var day = dt.getDate();
                var h = dt.getHours();//获取时
                var m = dt.getMinutes();//获取分
                var s = dt.getSeconds();//获取秒
                document.querySelector(".showTime").innerHTML = '当前时间：' + y + "年" + mt + "月" + day + "-" + h + "时" + m + "分" + s + "秒";
                t = setTimeout(time, 1000); //设定定时器，循环运行     
            }
        </script>
    </header>

<!-- 主体部分 -->
    <section class="mainbox">
        <div class="column">
            <div class="text" style="border: 1px black solid;">
                <h2 style="line-height: 20px; font-size: 20px;text-align: center;">最新地震</h2>
                <div class="content" style="height: 150px;display: flex;">
                    <div class="left" style="width: 110px; background-color: aqua;">
                        <div style="margin-left: 10px; margin-bottom: 20px;margin-top: 20px;">发震时间：</div>
                        <div style="margin-left: 10px; margin-bottom: 20px;">震中位置：</div>
                        <div style="margin-left: 10px; margin-bottom: 20px;">地震强度：</div>
                        <div style="margin-left: 10px; margin-bottom: 20px;">A          B：</div>
                        <div style="margin-left: 10px;">震中地名：</div>
                    </div>
                    <div class="right" style="width:200px; background-color: rgb(18, 138, 88); margin-left: 20px;">

                    </div>
                </div>
            </div>
            <div class="panel bar">
                <h2>柱状图</h2>
                <!-- <div class="chart">图表</div> -->
                    <!-- 为 ECharts 准备一个定义了宽高的 DOM -->
                <div class="box"></div>
                <script src="js/echarts.min.js"></script>
                <script>
                // 基于准备好的dom，初始化echarts实例
                var myChart = echarts.init(document.querySelector('.box'));
                // 指定图表的配置项和数据
                var option = {
                xAxis: {
                    type: 'category',
                    data: ['Mon', 'Tue', 'Wed', 'Thu', 'Fri', 'Sat', 'Sun']
                },
                yAxis: {
                    type: 'value'
                },
                series: [{
                    data: [820, 932, 901, 934, 1290, 1330, 1320],
                    type: 'line'
                }]
            };
            
                // 使用刚指定的配置项和数据显示图表。
                myChart.setOption(option)
                </script>
                <div class="panel-footer"></div>
            </div>
            <div class="panel line">
                <!-- <h2>地震深度频率表</h2> -->
                <!-- <div class="chart">图表</div> -->
                    <!-- 为 ECharts 准备一个定义了宽高的 DOM -->
                    <div class="box2"></div>
                    <script src="js/echarts.min.js"></script>
                    <script>
                    // 基于准备好的dom，初始化echarts实例
                    var myChart = echarts.init(document.querySelector('.box2'));
                    // 指定图表的配置项和数据
                    option = {

                        title: {
                            text: '地震深度频率图',
                            left: 'center'
                        },
                        tooltip: {
                            trigger: 'item'
                        },
                        legend: {
                            orient: 'vertical',
                            left: 'left'
                        },
                        series: [
                            {
                            name: 'Access From',
                            type: 'pie',
                            radius: '50%',
                            data: [
                                { value: 153491, name: '浅源地震' },
                                { value: 47391, name: '中源地震' },
                                { value: 12224, name: '深源地震' },
                            ],
                            emphasis: {
                                itemStyle: {
                                shadowBlur: 10,
                                shadowOffsetX: 0,
                                shadowColor: 'rgba(0, 0, 0, 0.5)'
                                }
                            }
                            }
                        ]
                        };
                
                    // 使用刚指定的配置项和数据显示图表。
                    myChart.setOption(option)
                    </script>

            </div>
